import classes from "./Available.module.css";
import Card from "../UI/Card";

const TEMPLATE_MEALS = [
  {
    id: 'm1',
    name: 'Sushi',
    description: 'Finest fish and veggies',
    price: 22.99,
  },
  {
    id: 'm2',
    name: 'Schnitzel',
    description: 'A german specialty!',
    price: 16.5,
  },
  {
    id: 'm3',
    name: 'Burger',
    description: 'American, raw, meaty',
    price: 12.99,
  },
  {
    id: 'm4',
    name: 'Green Bowl',
    description: 'Healthy...',
    price: 18.99,
  },
];

const Available = () => {
  const foodList = TEMPLATE_MEALS.map((meal) => <li>{meal.name}</li>)

  return (
    <>
      <section className={classes.meals} key={foodList.id}>
        <Card>
          <ul>{foodList}</ul>
        </Card>
      </section>
    </>
  )
}

export default Available;
